package String;

public class StringDemoComparingequals {

	public static void main(String[] args) {
	
		// TODO Auto-generated method stub
String s= "Welcome";
System.out.println(s.equals("Welcome"));
System.out.println(s.equals("w elcom e"));

System.out.println(s.equals("wel c ome"));
System.out.println(s.equalsIgnoreCase("Welcome"));//Ignore the upper/lowerCase



	}

}
